import React from 'react'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Boxoffice  from './component/Basics/Boxoffice';
import Register from './component/register/register';
import Login from './component/login/login';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { useState } from 'react';



const App = () => {
  return( 
    <>
    <Router>
      <Switch>
        <Route path="/"><Boxoffice/></Route>
        <Route path="/login"><Login/></Route>
        <Route path="/registe"></Route>


      </Switch>
    </Router>
  <Boxoffice/>
  <Register/>
  <Login/>
  </>
  )};

export default App;
